import {MatchDetailCard} from '../components/MatchDetailCard';
import {MatchSmallCard} from '../components/MatchSmallCard';
import {React,useEffect,useState} from 'react';

export function TeamPage() {
    const [team,setTeam] = useState({});
    useEffect(
    ()=>{
        const getTeamData = async()=>{
            const response = await fetch('http://localhost:8084/team/teamName/Mumbai Indians');
            const data = await response.json();
            setTeam(data);
        }

        getTeamData();
    },[]
    )
  return (
    <div className="TeamPage">
      <h2>{team.teamName}</h2>
      <MatchDetailCard match={team.matchList[0]}/>
      <MatchSmallCard match={team.matchList[1]}/>
      <MatchSmallCard match={team.matchList[2]}/>
      <MatchSmallCard match={team.matchList[3]}/>
    </div>
  );
}
